import React,{Component} from 'react'

class Navbar extends Component {
    render(){
        return(
            <div className="nav-wrapper">

            <h4 className="center">Context App</h4>
            <ul className="row center">
                <li>Home</li> 
                <li>About</li> 
                <li>Contact</li> 

            </ul>
            </div>
        )
    }
}
export default Navbar
